//import logoImg from './../../img/icons/logo.svg'
import "./header.css";

export default function Header() {
  return (
    
      <dv class="container">
        <div class="header__inner">
          <div class="header__logo"> MvVan</div>
          <nav class="nav">
            <a class="nav__link active" href="index.html">
              Home
            </a>
            <a class="nav__link" href="gaz.html">
              страсть
            </a>
            <a class="nav__link" href="io/mih.html">
              версия миши
            </a>
          </nav>
        </div>
      </dv>
    
  );
}
